<!DOCTYPE html>
<html>
  <head>
    <meta charset="UTF-8" />
    <title>Page Not Found</title>
  </head>
  <body>
    <script type="text/javascript">
      // Redirect to the correct URL
      var path = window.location.pathname;
      var newUrl = window.location.protocol + "//" + window.location.host + "/Launcher-React-/" + path.substring(1);
      window.location.replace(newUrl);
    </script>
  </body>
</html>
